import './JobsComponent.css';

export default function JobsComponent(){
    return(
        <>
            <div className="card mt-4 col-12 col-sm-12 col-md-7">
                <div className="card-body">
                    <h6 className="jobs-component-heading">
                        Intern Software Engineer
                    </h6>
                </div>
            </div>
        </>
    );
}
